import React from 'react'
import TextField from '@material-ui/core/TextField'

export const TaskNameInput = ({ data, edit, work, action }) => {
    let isAccess

    if(work){
        isAccess = true
    } else {
        isAccess = false
    }

    return(
        <div>
            <form onSubmit={action}>
                <TextField 
                id="standard-basic" label="Enter task name"
                    value={data}
                    onChange={edit}
                    disabled={isAccess}
                />
            </form>
        </div>
    )
}
